async function getGeo(city) {
  const response = await fetch(`http://api.openweathermap.org/geo/1.0/direct?q=${city}&appid=ed5ff69a9a55d7bb14fda92a70690f61`, {
    mode: 'cors'
  });
  const json = await response.json();
  return json;
}
